import logo from "./logo.svg";
import "./App.css";

function App() {
  const users = [
    { name: "John Doe", id: 1 },
    { name: "Jane Doe", id: 2 },
    { name: "Billy Doe", id: 3 },
  ];
  return (
    <div>
      <h3>User names</h3>
      <ul>
        {users.map((user) => {
          <li key={user.id}>{user.name}</li>;
        })}
      </ul>
    </div>
  );
}

export default App;
